import React, { Component } from 'react';
import './App.css';

class Comic extends Component {
    constructor(props) {
    super(props);
        this.toggleNavBar = this.toggleNavBar.bind(this);
        this.togglePopOver = this.togglePopOver.bind(this);
        this.handleClickLikeOn = this.handleClickLikeOn.bind(this);
        this.handleClickLikeOff = this.handleClickLikeOff.bind(this);
        this.handleClick = this.handleClick.bind(this);

        this.state = {
          comics : []
        };
      }


    componentDidMount(){
        var ctx = this;    
        fetch('http://localhost:3000/marvel')
        .then(function(response,) {
          return response.json();
        })
        .then(function(data) {
        console.log("MES COMICS",data)
        ctx.setState({comics : data.comics});
        })
        .catch(function(error) {
          console.log('Request failed', error)
        });
      }
  render() {

    return (
      <div className="App">
      <h1>TEST</h1>
      </div>
    );
  }
}

export default Comic;
